import React from 'react';
import ReactDOM from 'react-dom';
import {BrowserRouter, Switch, Route} from 'react-router-dom';
import * as serviceWorker from './serviceWorker';
import 'bootstrap/dist/css/bootstrap.css';
import './index.css';

//List Componentes Pages
import Menu from './core/menu/Menu';
import App from './App';
import Login from './pages/login/index';
import Cargo from './pages/cargo/index';
import NotFound from './pages/not-found/index';

ReactDOM.render(
    <BrowserRouter>
        <Menu />,
        <Switch>

            <Route path="/" exact={true} component={App} />
            <Route path="/login" exact={true} component={Login} />

            <Route path="/cargo" component={IndexCargo} />
            <Route path="/cargo/add" component={FormCargo} />
            <Route path="/cargo/edit/" component={FormCargo} />

            {/* <PrivateRoute path="/cargo" component={Cargo} /> */}

            <Route path='*' component={NotFound} />
        </Switch>
    </BrowserRouter>
    ,document.getElementById('root'));

serviceWorker.unregister();
